ControlPropertyState.AutoRuleBindingString:
If(
    PasswordTF_1.Text = confirmPasswordTF_1.Text,
    If(
        //check if any user with email exist
        CountRows(
            Filter(
                Users,
                EmailTF_1.Text = Email
            )
        ) = 0,
        //if it doesnt exist allow to register
        Patch(
            Users,
            Defaults(Users),
            {
                Title: Lower(
                    Concatenate(
                        FirstNameTF_1.Text,
                        ".",
                        LastNameTF_1.Text,
                        RandBetween(
                            100,
                            999
                        )
                    )
                ),
                FirstName: FirstNameTF_1.Text,
                LastName: LastNameTF_1.Text,
                Email: EmailTF_1.Text,
                PhoneNumber: PhoneNumberTF_1.Text,
                Nationality: NationalityRB_1.Selected.Value,
                CNIC: If(
                    NationalityRB_1.Selected.Value = "Pakistani",
                    CNICTF_1.Text,
                    ""
                ),
                PassportNumber: If(
                    NationalityRB_1.Selected.Value = "Pakistani",
                    "",
                    CNICTF_1.Text
                ),
                Country: If(
                    NationalityRB_1.Selected.Value = "Pakistani",
                    "Pakistan",
                    Country_1.Selected.Value
                ),
                ProgramsInterestedIn: ProgramsDropDown_1.Selected.Value,
                Password: PasswordTF_1.Text
            }
        );
        //Save Users info in local app collection and navigate
        Collect(
            User,
            Filter(
                Users,
                LoginTF.Text = Email
            )
        );
        Navigate(
            'Home Screen',
            ScreenTransition.Fade
        ),
        //else notify the error
        Notify(
            "Account with same email, try Login.",
            NotificationType.Error
        )
    ),
    Notify(
        "Password and Confirm Password do not match.",
        NotificationType.Error
    )
);

Table({
    step:1,
    stepText: "Personal Details",
    stepFlag: 1,
    isCurrent: true
})
